def alNumSet():
    alpha = [] 
    for i in xrange(ord("a"),ord("z")+1):
        alpha.append("%c"%i)
    for i in xrange(ord("A"),ord("Z")+1):
        alpha.append("%c"%i)
    for i in xrange(ord("0"),ord("9")+1):
        alpha.append("%c"%i)

    return alpha

